Canada Photo Summit…. the first one ever! Wow.

We are beyond grateful to all of the attendees, sponsors, speakers and team who came together to make this such a successful event. When we (Taylor + Lindsay) came up with the idea of hosting this conference in our home town of Waterloo, we weren’t sure how it would go.

We knew we wanted to invite some of our friends to speak, and we knew we wanted to cultivate our own Canada Photo Summit community.

Over three days, we had parties, we made friends, and we heard from some of the most talented photographers in the industry. All of us left feeling inspired to try a bit harder, do something different, and expand our creative abilities. 

We’re beyond excited to be back again in the Spring (April 22-24) - this time with speakers focusing not just on weddings, but also portraits + event photography. Tickets are on sale right now at the early bird rate of $149 CAD… don’t miss out, the price is going up October 31st! Link to purchase is in bio.

